import { useEffect, useState } from "react";

export default function SellerFlightsPage() {
  const [flights, setFlights] = useState([]);

  // Mock seller-added flights (replace with API call)
  useEffect(() => {
    setFlights([
      {
        id: "FL001",
        airline: "Delta Airlines",
        flightNo: "DL245",
        from: "JFK",
        to: "LAX",
        depart: "08:30 AM",
        arrive: "11:15 AM",
        price: 299,
      },
      {
        id: "FL002",
        airline: "American Airlines",
        flightNo: "AA110",
        from: "ORD",
        to: "MIA",
        depart: "09:45 AM",
        arrive: "01:00 PM",
        price: 320,
      },
    ]);
  }, []);

  const handleDelete = (id) => {
    if (!window.confirm("Are you sure you want to delete this flight?")) return;
    setFlights(flights.filter((f) => f.id !== id));
  };

  const handleEdit = (id) => {
    alert("Navigate to Edit Flight Page for: " + id);
  };

  const handleView = (id) => {
    alert("Viewing flight details for: " + id);
  };

  return (
    <div style={styles.page}>
      <main style={styles.hero}>
        <div style={styles.heroInner}>

          <h2 style={styles.title}>Manage Your Flights</h2>

          <div style={styles.sectionCard}>
            <h3>Flights You Added</h3>

            <table style={styles.table}>
              <thead>
                <tr>
                  <th style={styles.th}>Flight ID</th>
                  <th style={styles.th}>Airline</th>
                  <th style={styles.th}>Flight No</th>
                  <th style={styles.th}>Route</th>
                  <th style={styles.th}>Departure</th>
                  <th style={styles.th}>Arrival</th>
                  <th style={styles.th}>Price ($)</th>
                  <th style={styles.th}>Actions</th>
                </tr>
              </thead>

              <tbody>
                {flights.map((f) => (
                  <tr key={f.id} style={styles.tr}>
                    <td style={styles.td}>{f.id}</td>
                    <td style={styles.td}>{f.airline}</td>
                    <td style={styles.td}>{f.flightNo}</td>
                    <td style={styles.td}>{f.from} â†’ {f.to}</td>
                    <td style={styles.td}>{f.depart}</td>
                    <td style={styles.td}>{f.arrive}</td>
                    <td style={styles.td}>${f.price}</td>

                    <td style={styles.actionCol}>
                      <button 
                        style={styles.viewBtn}
                        onClick={() => handleView(f.id)}
                      >
                        View
                      </button>

                      <button 
                        style={styles.editBtn}
                        onClick={() => handleEdit(f.id)}
                      >
                        Edit
                      </button>

                      <button 
                        style={styles.deleteBtn}
                        onClick={() => handleDelete(f.id)}
                      >
                        Delete
                      </button>
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>

          </div>
        </div>
      </main>
    </div>
  );
}

/*************  STYLES  *************/
const styles = {
  page: {
    fontFamily: "system-ui, sans-serif",
    color: "#111",
  },
  hero: {
    background: "#f6f7fbce",
    padding: "30px 0",
    borderRadius: "20px",
    width: "1200px",
    margin: "20px auto",
    boxShadow: "0 2px 8px rgba(0,0,0,0.05)",
  },
  heroInner: {
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    gap: 25,
  },
  title: {
    fontSize: 28,
    fontWeight: 700,
  },
  sectionCard: {
    width: "1100px",
    background: "white",
    border: "1px solid #e7ebf0",
    borderRadius: 12,
    padding: 25,
    boxShadow: "0 1px 3px rgba(0,0,0,.05)",
  },
  table: {
    width: "100%",
    borderCollapse: "collapse",
    marginTop: 15,
  },
  th: {
    textAlign: "left",
    padding: "12px 10px",
    background: "#f0f2f5",
    borderBottom: "1px solid #ddd",
    fontWeight: 600,
  },
  tr: {
    borderBottom: "1px solid #eee",
  },
  td: {
    padding: "12px 10px",
  },
  actionCol: {
    display: "flex",
    gap: 10,
    padding: "12px 10px",
  },
  viewBtn: {
    padding: "6px 12px",
    background: "#4b8ef7",
    color: "white",
    border: "none",
    borderRadius: 6,
    cursor: "pointer",
    fontSize: 13,
  },
  editBtn: {
    padding: "6px 12px",
    background: "#f7b84b",
    color: "white",
    border: "none",
    borderRadius: 6,
    cursor: "pointer",
    fontSize: 13,
  },
  deleteBtn: {
    padding: "6px 12px",
    background: "#e25454",
    color: "white",
    border: "none",
    borderRadius: 6,
    cursor: "pointer",
    fontSize: 13,
  },
};
